import { useState, useEffect } from "react";
import Axios from "axios";


export const RecipeView = () => {
    const [pokemonData, setPokemonData] = useState();

    const getDataFromPokemonAPI = () => {
        Axios.get('https://pokeapi.co/api/v2/pokemon/ditto')
        .then(response => setPokemonData(response))
        .catch(error => console.log(error))
    } 

    useEffect(() => {
        getDataFromPokemonAPI();
    }, []);

    return (
        <div>
            <h1>RecipeView</h1>
            <h1>{pokemonData?.data?.name}</h1>
            <h1>{pokemonData?.data?.id}</h1>
            <button onClick={() => console.log(pokemonData?.data?.types)}>Test API call</button>
        </div>
    )
}
